import React from "react";
import Data from './colleges.json'




const Card=()=> {
    return (
      <div className="App">
       
          { Data.colleges.map((post) => {

            return (
              <>
             
               <div className="card-container background ">
              
               <p className="inimg">{post.rating}/5<br/>{post.rating_remarks}</p>
                       <p className="innerr">{post.tags}</p>
                       <p className="rank">#{post.ranking}</p>
                       </div>
                       <p style={{marginLeft:"15px",fontWeight:"bold",color:"gray"}}>{post.college_name}</p> 
              
              </>
            )
          })}
        </div>
    
    );
  }
  
export default Card
